h\":544,\"height\":294,\"size\":12813901,\"views\":1666,\"bandwidth\":21347959066,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"account_url\":\"Raph304\",\"account_id\":4433291,\"comment_preview\":null,\"topic\":\"Awesome\",\"topic_id\":5,\"gifv\":\"http://i.imgur.com/NBnp28j.gifv\",\"webm\":\"http://i.imgur.com/NBnp28j.webm\",\"mp4\":\"http://i.imgur.com/NBnp28j.mp4\",\"link\":\"http://i.imgur.com/NBnp28j.gif\",\"looping\":true,\"comment_count\":3,\"ups\":7,\"downs\":5,\"points\":2,\"score\":2,\"is_album\":false},{\"id\":\"7wy9Z\",\"title\":\"Hungry? Broke? If you can spare about 45 minutes of prep time, this will feed you for a week for $15\",\"description\":null,\"datetime\":1450402746,\"cover\":\"M18aaEm\",\"cover_width\":2340,\"cover_height\":4160,\"account_url\":\"MightyMoose\",\"account_id\":1034157,\"privacy\":\"public\",\"layout\":\"blog\",\"views\":540,\"link\":\"http://imgur.com/a/7wy9Z\",\"ups\":33,\"downs\":0,\"points\":33,\"score\":33,\"is_album\":true,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"comment_count\":6,\"comment_preview\":null,\"topic\":\"The More You Know\",\"topic_id\":11,\"images_count\":4},{\"id\":\"V4FOr\",\"title\":\"Food Posters\",\"description\":\"This time readable\",\"datetime\":1450391454,\"cover\":\"EK4SUsr\",\"cover_width\":620,\"cover_height\":2790,\"account_url\":\"dutch72\",\"account_id\":21360207,\"privacy\":\"public\",\"layout\":\"blog\",\"views\":523,\"link\":\"http://imgur.com/a/V4FOr\",\"ups\":45,\"downs\":5,\"points\":40,\"score\":40,\"is_album\":true,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"comment_count\":4,\"comment_preview\":null,\"topic\":\"The More You Know\",\"topic_id\":11,\"images_count\":6},{\"id\":\"wf6t4Zq\",\"title\":\"I've been obsessed with soft-boiled eggs. Here's one paired with Spicy Orzo and Fennel and Kale. So velvety, so good. \",\"description\":null,\"datetime\":1450412296,\"type\":\"image/jpeg\",\"animated\":false,\"width\":2000,\"height\":1358,\"size\":4233835,\"views\":63338,\"bandwidth\":268162641230,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"food\",\"account_url\":\"kylierosetypo\",\"account_id\":12493414,\"comment_preview\":null,\"topic\":\"No Topic\",\"topic_id\":29,\"link\":\"http://i.imgur.com/wf6t4Zq.jpg\",\"comment_count\":4,\"ups\":14,\"downs\":1,\"points\":13,\"score\":43,\"is_album\":false},{\"id\":\"hQRO51T\",\"title\":\"Braised veal shank with porcini mushroom and veal stock risotto\",\"description\":\"recipe:\n\n1 veal shank\n80-100grams of arborio or carnaroli rice (those on a budget can use originario)\n10 grams of dried porcini mushrooms\n1 very small or half a small onion, finely diced\n1 clove of garlic, finely minced\n1/4 cup 35% cream\n1 cup dry white wine. (Fontana Di Pappa brand Coli Albani is perfect and costs about $6 for a standard sized bottle.)\nStock (I've never really kept track of how much I use. I'd say about 4 cups, maybe a bit more to account for evaporation and such)\n\n* note about the stock: You can use boxed beef or veal broth, even chicken. I wouldn't recommend bouillon cubes, there are some very nice ones but most taste tinny. You could also make your own, a nice all purpose stock I use consists of a few beef shanks or neck bones, a whole chicken, a couple of tomatoes, a couple of carrot sticks, 3 stalks of celery, a large onion, a few cloves of garlic, a couple of tomatoes, four or five bay leaves, 4-5 allspice berries, a teaspoon or half a teaspoon of cloves, half a bunch of parsley, whole peppercorns. Just stuff it all in a pot and cover with water and simmer for several hours.\n\nBUT I DIGRESS\n\nTo prepare the veal , salt and pepper both sides of the shank liberally. Bring a small heavy bottomed pot or dutch over to temperature and add a tablespoon or so of oil. When you see wisps of white smoke coming from the oil you may add the shank. Get a hard sear on both sides and add a cup of wine and half a cup of stock. Should come at least half way up the shank. Cover and reduce the heat to medium low. 3 (out of 10) is the perfect setting on my stove, don't know about yours. You want to maintain a simmer but you don't want to burn the bottom or have the shank stick.\nCook for one hour and flip the shank, then cook another hour.\n\nAbout 20 minutes before the shank is done, heat your broth and soak your porcini mushrooms in enough boiling broth to cover them completely(shouldn't be more than a ladle or two) and let sit for 10 minutes. \nKeep your stock hot, not quite boiling but almost.\nWhen the shank is done, set it aside and cover with tinfoil. Pour the braising liquid into a bowl and set aside. \nReturn the pot you cooked it in to the stove. Melt a large(don't be shy) tab of butter in the same pot and sautee the onions until translucent and just on the cusp of browning (you don't actually want them to brown, keep that in mind, though it wouldn't be a tragedy if they did)\n\nWhile your onions sautee, strain your porcini mushrooms BUT BE SURE TO SAVE THE LIQUID THEY STEEPED IN**. I recommend fishing the mushrooms out of the bowl with a small strainer so as not to deposit any sand that may be in the steeping liquid back onto the mushrooms. \n\nAdd the drained mushrooms to the onions and butter, sautee for a minute or two while you strain the reserved mushroom liquid yet again, this time through a strainer lined with paper towel or cheese cloth so as to filter out any sand particles. This step is not always necessary, so use your best judgement, but be warned: gritty risotto makes everybody sad.\n\nAdd your rice to the onions and mushrooms. Sautee for a minute or two, stirring frequently, aromatizing the rice and coating each grain with butter. Turn your heat up, almost at max, maybe 7 or 8 (out of 10), and add your reserved braising liquid and the broth your mushrooms steeped in to the rice. Stir constantly until the liquid is mostly evaporated\nRepeat this step indefinitely with a ladle of broth, stirring near constantly all the while.\n\nWhen the rice is visibly larger begin testing for doneness. When the rice is slightly toothsome/gritty but nearly ready, add a tab of butter and a quarter cup of cream. Depending on how much liquid there is at this point it may be wise to add a half ladle or so of broth.  Stir to incorporate and turn off the heat. The residual heat from the pan/burner will continue to cook the risotto while you go set the table or whatever. Let it rest for about 10 minutes, stirring every once in a while\n\nThe risotto will thicken as the starches cool slightly. This is my preferred texture for risotto, though you could serve it right away as some do. \nPile it onto a plate or spread it out all fancy like, top with your veal shank and pour any drippings from the plate you kept it on over top. Parm is optional but recommended. \n\nOh, and one more thing; please give the marrow a chance. It's really fucking good. Just spoon that shit out and eat it. \n\n\",\"datetime\":1450411250,\"type\":\"image/jpeg\",\"animated\":false,\"width\":960,\"height\":960,\"size\":149424,\"views\":1929,\"bandwidth\":288238896,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"account_url\":\"RokudoMukuro\",\"account_id\":6290576,\"comment_preview\":null,\"topic\":\"The More You Know\",\"topic_id\":11,\"link\":\"http://i.imgur.com/hQRO51T.jpg\",\"comment_count\":14,\"ups\":16,\"downs\":4,\"points\":12,\"score\":12,\"is_album\":false},{\"id\":\"wgZKVh3\",\"title\":\"Stuffed Jalapenos\",\"description\":\"20 jalapenos \n1 lbs ground pork\n3 cloves garlic, minced\n\u00bc tsp paprika\nsalt and pepper, to taste\n1 C ricotta\n1 C cheese (I used half parmesan and half cheddar)\npanko for topping\noil for cooking\n\n1. Preheat the oven to 375 F\n2. Cut the jalapenos in half lengthwise and remove the seeds. Place them on a lined cookie sheet.\n3. WASH YOUR HANDS!\n4. Heat an oiled skillet to medium-low heat and saut\u00e9 the garlic for about 2 mins (make sure not to burn them). Increase the heat to medium, add the ground pork, and cook for about 10 mins until there is no pink remaining. Add in paprika and salt and pepper to taste.\n5. Put the meat in a bowl, add the cheeses, and mix.\n6. Firmly stuff about 1 tablespoon (or more) of meat mixture into the halved jalapenos. Top each stuffed jalapeno with panko bread crumbs. Spray a bit of oil over the panko to allow for browning.\n7. Bake uncovered for 25 mins to 30 mins.\",\"datetime\":1450408556,\"type\":\"image/jpeg\",\"animated\":false,\"width\":1500,\"height\":1000,\"size\":545885,\"views\":1502,\"bandwidth\":819919270,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"account_url\":\"emicooks\",\"account_id\":25965299,\"comment_preview\":null,\"topic\":\"The More You Know\",\"topic_id\":11,\"link\":\"http://i.imgur.com/wgZKVh3.jpg\",\"comment_count\":9,\"ups\":14,\"downs\":2,\"points\":12,\"score\":12,\"is_album\":false},{\"id\":\"lRMxkvK\",\"title\":\"The trick play that put St. Thomas on the map\",\"description\":\"http://www.twincities.com/sports/ci_29268571/\",\"datetime\":1450384754,\"type\":\"image/gif\",\"animated\":true,\"width\":480,\"height\":270,\"size\":3809593,\"views\":4972,\"bandwidth\":18941296396,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"account_url\":\"lindo1905\",\"account_id\":13765803,\"comment_preview\":null,\"topic\":\"Awesome\",\"topic_id\":5,\"gifv\":\"http://i.imgur.com/lRMxkvK.gifv\",\"webm\":\"http://i.imgur.com/lRMxkvK.webm\",\"mp4\":\"http://i.imgur.com/lRMxkvK.mp4\",\"link\":\"http://i.imgur.com/lRMxkvK.gif\",\"looping\":true,\"comment_count\":8,\"ups\":43,\"downs\":3,\"points\":40,\"score\":42,\"is_album\":false},{\"id\":\"6t0f9KO\",\"title\":\"Lobster poutine\",\"description\":\"This delicious variation on poutine has buttered lobster chunks, feta cheese curds, and a creamy gravy made from lobster stock.\n\nFind the recipe here:\nhttp://strandedontheisland.com/lobster-poutine/\",\"datetime\":1450312046,\"type\":\"image/jpeg\",\"animated\":false,\"width\":2538,\"height\":2363,\"size\":1118227,\"views\":128482,\"bandwidth\":143672041414,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"account_url\":\"sp808\",\"account_id\":27996405,\"comment_preview\":null,\"topic\":\"The More You Know\",\"topic_id\":11,\"link\":\"http://i.imgur.com/6t0f9KO.jpg\",\"comment_count\":101,\"ups\":1720,\"downs\":73,\"points\":1647,\"score\":1710,\"is_album\":false},{\"id\":\"MQ3o5uf\",\"title\":\"My first Christmas dinner\",\"description\":\"So its going to be my first time cooking a north american style Christmas dinner and I need some pointers from you guys. I'm German so growing up I've had traditional German dishes but I'll be cooking for Canadians who will be expecting their traditional dishes.  I'm planning to steam some brussels sprouts, cook some red cabbage and Semmel Kn\u00f6del (traditional german christmas food) and roast parsnips with carrots.\nI don't know what kind of foods should go on the table, hence the German fusion.\n\n-What should I be watching out for when cooking the bird?\n-What kind of stuffing would you recommend?\n-Are there any side dishes/appetisers that are traditionally served on Christmas?\n-Getting a 12lb turkey for 8 people (overkill?!)\n-What do people drink besides red wine and eggnog?\",\"datetime\":1450411867,\"type\":\"image/jpeg\",\"animated\":false,\"width\":1920,\"height\":1080,\"size\":521653,\"views\":1266,\"bandwidth\":660412698,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"account_url\":\"Waldmeister\",\"account_id\":16082373,\"comment_preview\":null,\"topic\":\"Current Events\",\"topic_id\":17,\"link\":\"http://i.imgur.com/MQ3o5uf.jpg\",\"comment_count\":8,\"ups\":9,\"downs\":2,\"points\":7,\"score\":7,\"is_album\":false},{\"id\":\"zGVnPAu\",\"title\":\"Not a Simple Teh  'O\",\"description\":\"This is a takeaway drink in Southeast Asia.\nTranslation:\n1 Teh O (Tea without Milk, O' = 'black' in Hokkien)\nCold (Cold, what else)\nKurang Manis (Not so sweet, aka. Less sugar)\n\nIkat tepi (Tie it at the side for immediate consumption, as opposed to fully closing it)\nAis batu lebih sikit (Add more ice cubes)\n\nThe fact that it has all these attentive details (Including time stamp) printed out and attached for a drink that costs less than 0.50USD is hardcore and baffling.\",\"datetime\":1450425588,\"type\":\"image/png\",\"animated\":false,\"width\":529,\"height\":694,\"size\":859985,\"views\":4139,\"bandwidth\":3559477915,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"malaysia\",\"account_url\":\"XaladinRR\",\"account_id\":28147725,\"comment_preview\":null,\"topic\":\"Awesome\",\"topic_id\":5,\"link\":\"http://i.imgur.com/zGVnPAu.png\",\"comment_count\":5,\"ups\":7,\"downs\":4,\"points\":3,\"score\":3,\"is_album\":false},{\"id\":\"vMIF3\",\"title\":\"How to Make Home-made Tim Tams\",\"description\":null,\"datetime\":1450364318,\"cover\":\"Bo27GRi\",\"cover_width\":600,\"cover_height\":878,\"account_url\":\"SatansDuckling\",\"account_id\":7331462,\"privacy\":\"public\",\"layout\":\"blog\",\"views\":1129,\"link\":\"http://imgur.com/a/vMIF3\",\"ups\":69,\"downs\":2,\"points\":67,\"score\":67,\"is_album\":true,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"comment_count\":28,\"comment_preview\":null,\"topic\":\"Awesome\",\"topic_id\":5,\"images_count\":6},{\"id\":\"jaTfpc1\",\"title\":\"We're having  a Star Wars dessert contest at our office Xmas Party.  This is my submission\",\"description\":\"I call it 'Deathstar By Chocolate.'\",\"datetime\":1450383153,\"type\":\"image/jpeg\",\"animated\":false,\"width\":3116,\"height\":4084,\"size\":2110178,\"views\":5432,\"bandwidth\":11462486896,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"food\",\"account_url\":\"rocktopusprime\",\"account_id\":1634678,\"comment_preview\":null,\"topic\":\"Star Wars\",\"topic_id\":61,\"link\":\"http://i.imgur.com/jaTfpc1.jpg\",\"c