75,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"account_url\":\"kaitowhynot\",\"account_id\":18493038,\"comment_preview\":null,\"topic\":\"Current Events\",\"topic_id\":17,\"link\":\"http://i.imgur.com/IPEFild.jpg\",\"comment_count\":17,\"ups\":12,\"downs\":3,\"points\":9,\"score\":9,\"is_album\":false},{\"id\":\"cEBoy\",\"title\":\"Beach Hut Deli, Las Vegas\",\"description\":null,\"datetime\":1450419686,\"cover\":\"YKrUMIN\",\"cover_width\":1836,\"cover_height\":2448,\"account_url\":\"Cavy\",\"account_id\":422023,\"privacy\":\"hidden\",\"layout\":\"blog\",\"views\":333,\"link\":\"http://imgur.com/a/cEBoy\",\"ups\":8,\"downs\":7,\"points\":1,\"score\":1,\"is_album\":true,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"comment_count\":3,\"comment_preview\":null,\"topic\":\"Awesome\",\"topic_id\":5,\"images_count\":2},{\"id\":\"qTOzB\",\"title\":\"Foccacia con patate e rosmarino\",\"description\":\"Foccacia con patate\nDough:\n2 g dry yeast\n350 ml lukewarm water \n2 teaspoon coarse salt\n550 g flour ( italian type 00)\n2 Tablespoons olive oil\n15 gluten\nTopping:\nolive oil to cover the dough\nRosemary (to taste)\nCoarse salt (to taste)\nCooked potatoes\nDissolve the yeast in the warm water. Mix in the salt, oil and flour. Knead the dough for 5 minutes, let it rest for 10 and knead for another 5 minutes.\nLet the dough rise for about 8 hours. \nSpread the dough a bit thicker than a pizza, cover it with olive oil and sprinkle it with kosher salt. Add the potatoes and brush them with olive oil.\nPlace the dough on the preheated (250 \u00b0C) pizza stone and let it bake until brown.\n \nIf you don&#039;t have a pizza stone:\nSpread the dough onto a lined baking pan with floured hands. Mine ended up being 3-4 cm\nthick. Poke the dough with your fingers and spread the oil on top. I did this with my fingers as\nwell, you could probably just brush it on if you don&#039;t like the mess. Sprinkle about a\ntablespoon or two of coarse salt on top. Let rise for another 20 minutes.\nBake in the middle of the oven at 225\u00b0C for 20-25 minutes.\",\"datetime\":1450353132,\"cover\":\"lBoQc21\",\"cover_width\":1836,\"cover_height\":3264,\"account_url\":\"HansSeidel\",\"account_id\":5900224,\"privacy\":\"public\",\"layout\":\"blog\",\"views\":2513,\"link\":\"http://imgur.com/a/qTOzB\",\"ups\":19,\"downs\":6,\"points\":13,\"score\":13,\"is_album\":true,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"Kochen\",\"comment_count\":5,\"comment_preview\":null,\"topic\":\"Awesome\",\"topic_id\":5,\"images_count\":6},{\"id\":\"qGOKZ\",\"title\":\"Rocky Christmas Road - making of\",\"description\":null,\"datetime\":1450363638,\"cover\":\"05PYHh4\",\"cover_width\":3120,\"cover_height\":4160,\"account_url\":\"Oferon\",\"account_id\":1477261,\"privacy\":\"public\",\"layout\":\"blog\",\"views\":470,\"link\":\"http://imgur.com/a/qGOKZ\",\"ups\":7,\"downs\":1,\"points\":6,\"score\":6,\"is_album\":true,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"comment_count\":2,\"comment_preview\":null,\"topic\":\"The More You Know\",\"topic_id\":11,\"images_count\":9},{\"id\":\"292vN9D\",\"title\":\"Oh, Thor...\",\"description\":null,\"datetime\":1450331131,\"type\":\"image/jpeg\",\"animated\":false,\"width\":500,\"height\":608,\"size\":83460,\"views\":2961,\"bandwidth\":247125060,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"account_url\":\"ASongFromTheBard\",\"account_id\":5061153,\"comment_preview\":null,\"topic\":\"Funny\",\"topic_id\":2,\"link\":\"http://i.imgur.com/292vN9D.jpg\",\"comment_count\":8,\"ups\":34,\"downs\":3,\"points\":31,\"score\":32,\"is_album\":false},{\"id\":\"EEwMN5h\",\"title\":\"Muffin Much\",\"description\":null,\"datetime\":1450328116,\"type\":\"image/png\",\"animated\":false,\"width\":610,\"height\":331,\"size\":237864,\"views\":2139,\"bandwidth\":508791096,\"vote\":null,\"favorite\":false,\"nsfw\":false,\"section\":\"\",\"account_url\":\"DecentHuma